import { useRef, useEffect } from 'react';
import uniqid from 'uniqid';
import { useCookies } from 'react-cookie';
import Router from 'next/router';
import SuperUser from './superUser/create.user.component';
import AddProduct from './management/add.product.component';
import EditProduct from './management/edit.product.component';

const MyBusinessComp = () => {
    const [cookies, setCookie] = useCookies(['user']);
    useEffect(() => {
        if(cookies.user 
            && cookies.user.rol !== 'master'){
            Router.push('/')
        }else if(!cookies.user){
            Router.push('/')
        }
    })
    return(
        <>
        <article className="content-metrics-header-mybusiness col-12 col-sm-12 col-lg-12 col-xl-12">
            <ul>
                <li>
                    Ventas: <span className='text-primary'>34.000</span>
                </li>
                <li>
                    Registros: <span className='text-secondary'>4.500</span>
                </li>
                <li>
                    Consultas: <span className='text-primary'>134.000</span>
                </li>
                <li>
                    Referidos: <span className='text-secondary'>15.000</span>
                </li>
                <li>
                    Productos y servicios: <span className='text-primary'>545.000</span>
                </li>
                <li>
                    Influencers: <span className='text-secondary'>250</span>
                </li>
            </ul>    
        </article>
        <article className="col-12 col-sm-12 col-lg-12 col-xl-12">
            <h2>Gestión</h2><hr/>
        </article>
       <AddProduct/>
        <EditProduct/>
        <article className="col-12 col-sm-12 col-lg-4 col-xl-4">
            <article className='col-12'>
                <h4 className='d-inline-flex'>Eliminar un producto</h4>
                <svg width="1em" height="1em" viewBox="0 0 16 16" className="ml-2 bi bi-trash" fill="currentColor" xmlns="http://www.w3.org/2000/svg">
                    <path d="M5.5 5.5A.5.5 0 0 1 6 6v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5zm2.5 0a.5.5 0 0 1 .5.5v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5zm3 .5a.5.5 0 0 0-1 0v6a.5.5 0 0 0 1 0V6z"/>
                    <path fillRule="evenodd" d="M14.5 3a1 1 0 0 1-1 1H13v9a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2V4h-.5a1 1 0 0 1-1-1V2a1 1 0 0 1 1-1H6a1 1 0 0 1 1-1h2a1 1 0 0 1 1 1h3.5a1 1 0 0 1 1 1v1zM4.118 4L4 4.059V13a1 1 0 0 0 1 1h6a1 1 0 0 0 1-1V4.059L11.882 4H4.118zM2.5 3V2h11v1h-11z"/>
                </svg>
                <form>
                    <input className='form-control d-block' type="search" placeholder='Ingrese su ID'/>
                    <input type="submit" value="Eliminar" className='mt-2 form-control d-block btn btn-danger'/>
                </form>
            </article>
        </article>
        <SuperUser/>
        </>
    )
}
/*
    rol: String*/

export default MyBusinessComp;
